(46, 1, '2024-01-23 13:27:56', '2024-01-23 10:27:56', '<style>/*! elementor - v3.18.0 - 20-12-2023 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img src=\"http://wordpress/wp-content/plugins/elementor/assets/images/placeholder.png\" title=\"\" alt=\"\" loading=\"lazy\" />															\n			<link rel=\"stylesheet\" href=\"http://wordpress/wp-content/plugins/elementor/assets/css/widget-icon-list.min.css\">		<ul>\n							<li>\n										123-456-7890\n									</li>\n						</ul>\n			<style>/*! elementor - v3.18.0 - 20-12-2023 */\n.elementor-heading-title{padding:0;margin:0;line-height:1}.elementor-widget-heading .elementor-heading-title[class*=elementor-size-]>a{color:inherit;font-size:inherit;line-height:inherit}.elementor-widget-heading .elementor-heading-title.elementor-size-small{font-size:15px}.elementor-widget-heading .elementor-heading-title.elementor-size-medium{font-size:19px}.elementor-widget-heading .elementor-heading-title.elementor-size-large{font-size:29px}.elementor-widget-heading .elementor-heading-title.elementor-size-xl{font-size:39px}.elementor-widget-heading .elementor-heading-title.elementor-size-xxl{font-size:59px}</style><h1>This Headline Grabs Visitors’ Attention</h1>		\n		<p>A short description introducing visitors to your business and the services you offer</p>		\n			<a href=\"#\">\n						Contact us\n					</a>\n															<img width=\"1024\" height=\"833\" src=\"http://wordpress/wp-content/uploads/2024/01/Image_Placeholder_Hero-1024x833.jpeg\" alt=\"\" srcset=\"http://wordpress/wp-content/uploads/2024/01/Image_Placeholder_Hero-1024x833.jpeg 1024w, http://wordpress/wp-content/uploads/2024/01/Image_Placeholder_Hero-300x244.jpeg 300w, http://wordpress/wp-content/uploads/2024/01/Image_Placeholder_Hero-768x624.jpeg 768w, http://wordpress/wp-content/uplo