INSERT INTO `wp_snippets` (`id`, `name`, `description`, `code`, `tags`, `scope`, `priority`, `active`, `modified`, `revision`, `cloud_id`) VALUES
(1, 'Сделать имена загружаемых файлов строчными', 'Убедитесь, что загружаемые изображения и файлы имеют имена файлов нижнего регистра.\n\nЭто образец сниппета. Вы можете использовать его, изменить или удалять.', 'add_filter( \'sanitize_file_name\', \'mb_strtolower\' );', 'sample, media', 'global', 10, 0, '2024-01-23 14:07:47', 2, NULL),
(2, 'Отключить панель администратора', 'Отключает панель администратора WordPress для всех, кроме администраторов.\n\nЭто образец сниппета. Вы можете использовать его, изменить или удалять.', 'add_action( \'wp\', function () {\n	if ( ! current_user_can( \'manage_options\' ) ) {\n		show_admin_bar( false );\n	}\n} );', 'sample, admin-bar', 'front-end', 10, 0, '2024-01-23 14:07:47', 2, NULL),
(3, 'Разрешить смайлики', 'Позволяет конвертировать смайлики в непонятные места.\n\nЭто образец сниппета. Вы можете использовать его, изменить или удалять.', 'add_filter( \'widget_text\', \'convert_smilies\' );\nadd_filter( \'the_title\', \'convert_smilies\' );\nadd_filter( \'wp_title\', \'convert_smilies\' );\nadd_filter( \'get_bloginfo\', \'convert_smilies\' );', 'sample', 'global', 10, 0, '2024-01-23 14:07:47', 2, NULL),
(4, 'Текущий год', 'Шорткод для вставки текущего года в запись или страницу.\n\nЭто образец сниппета. Вы можете использовать его, изменить или удалять.', '<?php echo date( \'Y\' ); ?>', 'sample, dates', 'content', 10, 0, '2024-01-23 14:07:47', 2, NULL),
(5, 'Добавление JQuery', '', 'add_action( \'wp_enqueue_scripts\', \'truemisha_jquery\' );\n \nfunction truemisha_jquery() {\n	wp_enqueue_script( \'jquery\' );\n}', '', 'global', 10, 0, '2024-01-23 14:16:31', 3, NULL);
